function exportarTabela() {
  // Obter os dados da tabela do localStorage
  const tabelaJSON = localStorage.getItem("dadosTabela");
  console.log(tabelaJSON);
  // Verificar se os dados foram recuperados com sucesso
  if (!tabelaJSON) {
    console.error("Tabela não encontrada no localStorage");
    return;
  }

  // Converter os dados da tabela de volta para um objeto JavaScript
  const dadosTabela = JSON.parse(tabelaJSON);

  // Obter o elemento do cabeçalho
  const headerElement = document.getElementById("header");
  if (!headerElement) {
    console.error("Elemento de cabeçalho não encontrado");
    return;
  }

  // Obter o nome da corrida e o título da página
  const nomeCorrida = headerElement.innerText || "";
  const tituloPagina = document.title; // Obtém o título da página

  const hoje = new Date();
  const ano = hoje.getFullYear();
  const mes = (hoje.getMonth() + 1).toString().padStart(2, "0");
  const dia = hoje.getDate().toString().padStart(2, "0");

  const dataFormatada = `${dia}-${mes}-${ano}`;

  const nomeArquivo = `${nomeCorrida}_${dataFormatada}_informacoes_tabela.xlsx`;

    //logo em base 64bits
    const logoBase64 =
      "";
    
  //Criar o WorkBook ExcelJS
  const wb = new ExcelJS.Workbook();
  const ws = wb.addWorksheet("Tabela");

  // Adicionar e centrar o logo à folha ecxel na coluna A
  const logoId = wb.addImage({
    base64: logoBase64,
    extension: "png",
  });

  ws.addImage(logoId, {
    tl: { col: 1, row: 1 },
    ext: { width: 105, height: 55 },
  });

  // Adicionar o título da página às células de A1 até G4
  ws.getCell("A1").value = tituloPagina;
  ws.mergeCells("A1:G4");
  ws.getCell("A1").alignment = { vertical: "middle", horizontal: "center" }; // Alinhar o texto centralizado

  // Definir o tamanho das colunas no Excel
  ws.columns = [
    { width: 20 }, // Coluna 'Camera'
    { width: 20 }, // Coluna 'Curva/Posto'
    { width: 20 }, // Coluna 'Hora'
    { width: 20 }, // Coluna 'Vídeo'
    { width: 20 }, // Coluna 'Report'
    { width: 20 }, // Coluna 'NFA'
    { width: 20 }, // Coluna 'Observações'
  ];

  // Adicionar o cabeçalho da tabela
  const headerRow = ws.addRow(["Camera", "Curva", "Hora", "Vídeo", "Report", "NFA", "Observações"]);
  headerRow.eachCell((cell) => {
    cell.font = { bold: true, color: { argb: "f2f2f2" } }; // Definir negrito e cor do texto
    cell.fill = {
      type: "pattern",
      pattern: "solid",
      fgColor: { argb: "575656" }, // Cor de fundo da célula do cabeçalho
    };
  });

  // Iterar sobre os dados da tabela e adicioná-los à planilha Excel
  dadosTabela.forEach((linha) => {
    const newRow = ws.addRow([
      linha.camera,
      linha.curva,
      linha.hora,
      linha.video ? "True" : "False",
      linha.report ? "True" : "False",
      linha.nfa ? "True" : "False",
      linha.obs || ""
    ]);
    // Adicionar formatação condicional para destacar linhas
    newRow.eachCell((cell, colNumber) => {
      if ((colNumber === 5 && linha.report) || (colNumber === 6 && linha.nfa)) {
        cell.fill = {
          type: "pattern",
          pattern: "solid",
          fgColor: { argb: linha.report ? "FF0000" : "FFFF00" } // Cor vermelha para 'Report' e amarela para 'NFA'
        };
      }
    });
  });

  // Criando o Blob e o link de download
  wb.xlsx.writeBuffer().then((buffer) => {
    const blob = new Blob([buffer], {
      type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet",
    });
    const link = document.createElement("a");
    link.href = URL.createObjectURL(blob);
    link.download = nomeArquivo;
    link.click();
  });
}